	add("heracles", "{\"term\":\"heracles\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἡρακλῆς\u0027 from \u0027ἥρα\u0027 (hera) + \u0027κλέος\u0027 (glory)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Son of Zeus and Alcmene, a celebrated hero who possessed exceptional strength. Most famous for his 12 labours performed to redeem himself after killing his family\", \"priority\":1}]}, \"synonyms\":{}}");

