	add("herald", "{\"term\":\"herald\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027heraud\u0027 from Old french (842-ca. 1400) \u0027heraut\u0027 \u0027hiraut\u0027 (French: \u0027héraut\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A messenger, especially one bringing important news\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027herald\u0027\u0027 blew his trumpet and shouted that the King was dead\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A harbinger, giving signs of things to come\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Daffodils are \u0027\u0027heralds\u0027\u0027 of Spring\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An official whose speciality is heraldry, especially one between the ranks of pursuivant and king of arms\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Rouge Dragon is a \u0027\u0027herald\u0027\u0027 at the College of Arms\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A moth of the species \u0027Scoliopteryx libatrix\", \"priority\":7}]}, \"synonyms\":{}}");

	add("herbage", "{\"term\":\"herbage\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027herbage\u0027 and Old french (842-ca. 1400) \u0027erbage\u0027 from \u0027\u0027 from Latin \u0027herba\u0027 (grass) alternatively, {{suffix|herb|age|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Herbs collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Herbaceous plant growth, especially grass\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1841\u0027\u0027, ‘A Descent into the Maelström’\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I threw myself upon my face, and clung to the scant \u0027\u0027herbage\u0027\u0027 in an excess of nervous agitation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, Mary Noailles Murfree, \u0027In the \u0026quot;Stranger People\u0027s\u0026quot; Country\u0027, Nebraska 2005, p. 97\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The dank breath of \u0027\u0027herbage\u0027\u0027, sodden with rain, came to her; the mists were barely visible, hovering above the dark ravines\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fleshy, often edible, parts of plants\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The natural pasture of a land, considered as distinct from the land itself; hence, right of pasture (on another man\u0027s land\", \"priority\":8}]}, \"synonyms\":{}}");

