	add("herbrandization", "{\"term\":\"herbrandization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after {{w|Jacques Herbrand}} (1908–1931), French mathematician.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The conversion of a formula of first-order logic which involves the following steps: (1) replace free variables with constants, (2) replace any variable bound by a universal quantifier which lies in the scope of an even number of logical negations with a Herbrand function, and (3) replace any variable bound by an existential quantifier which lies in the scope of an odd number of negations with a Herbrand function\", \"priority\":1}]}, \"synonyms\":{}}");

