	add("hercules", "{\"term\":\"hercules\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin Latin|Herculēs\u0027, from Ancient greek (to 1453) \u0027ἡρακλῆς\u0027 apparently from \u0027ἥρα\u0027 (hera) + \u0027κλέος\u0027 (glory)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Roman name for the Greek divine hero Heracles, who was the son of Jupiter and Alcmene, a celebrated hero who possessed exceptional strength. Most famous for his 12 labours performed to redeem himself after killing his family\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A summer constellation of the northern sky, said to resemble the mythical hero. It lies between the constellations Lyra and Corona Borealis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A crater in the first quadrant on the moon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A city in California\", \"priority\":4}]}, \"synonyms\":{}}");

