	add("herdthink", "{\"term\":\"herdthink\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|herd|think|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Reasoning based on or characteristic of uncritical acceptance of or conformity to a perceived majority view\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Jonathan Rauch, \u0027Kindly Inquisitors: The New Attacks on Free Thought\u0027, University of Chicago Press (1993), ISBN 9780226705750, [https://books.google.com/books?id\u003dE0lmeXyNakEC\u0026amp;pg\u003dPA111\u0026amp;dq\u003d%22herdthink%22 page 111\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But there is another America, too—an America of \u0027\u0027herdthink\u0027\u0027, of intolerance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, James J. Cramer, \u0027Jim Cramer\u0027s Getting Back to Even\u0027, Simon \u0026amp; Schuster (2009), ISBN 9781439163542, [https://books.google.com/books?id\u003dbuzZML1W120C\u0026amp;pg\u003dPA298\u0026amp;dq\u003d%22herdthink%22 page 298\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The most extreme and eventually the most dangerous kind of “\u0027\u0027herdthink\u0027\u0027” was hard to miss in the natural resource stocks, particularly the copper and natural gas stocks, as long as you knew what to look for\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Curtis Faith, \u0027Trading from Your Gut: How to Use Right Brain Instinct \u0026amp; Left Brain Smarts to Become a Master Trader\u0027, FT Press (2010), ISBN 9780137051687, [https://books.google.com/books?id\u003dUjBA0pF2CDsC\u0026amp;pg\u003dPA36\u0026amp;dq\u003d%22herdthink%22 page 36\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Traders also need to understand these cognitive biases to avoid \u0027\u0027herdthink\", \"priority\":7}]}, \"synonyms\":{}}");

