	add("heresy", "{\"term\":\"heresy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027heresie\u0027 (modern hérésie), from Latin \u0027haeresis\u0027 from Ancient greek (to 1453) \u0027αἵρεσις\u0027 (choice, system of principles) from \u0027αἱρέομαι\u0027 (to take for one’s self, to choose) the middle voice of \u0027αἱρέω\u0027 (to take) from Proto-indo-european {{m|ine-pro|*ster-}}; see also Welsh \u0027herw\u0027 (theft, raid) Ancient Greek \u0027στερέω\u0027 (to deprive of) \u0026lt;ref\u0026gt;J.P. Mallory and D.Q. Adams, \u0027Encyclopedia of Indo-European Culture\u0027 (London: Fitzroy Dearborn, 1999), 543.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doctrine held by a member of a religion at variance with established religious beliefs, especially dissension from Roman Catholic dogma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, History of Western Civilization, edited by Heyes, Baldwin \u0026amp; Cole, p.47. Macmillan. Library of Congress 67–1359\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Heresy\u0027\u0027 meant deliberate departure from the accepted doctrines of the church. It was intellectual and spiritual dissent and concerned the beliefs of Christianity, not the morals of its adherents\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A controversial or unorthodox opinion held by a member of a group, as in politics, philosophy or science\", \"priority\":4}]}, \"synonyms\":{}}");

	add("heretic", "{\"term\":\"heretic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027eretique\u0027 from \u0027haereticus\u0027 from Ancient greek (to 1453) \u0027αἱρετικός\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who, in the opinion of others, believes contrary to the fundamental tenets of a religion he claims to belong to\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the framework of traditional medical ethics, the patient\u0026lt;br\u0026gt; deserves humane attention only insofar as he is potentially\u0026lt;br\u0026gt; healthy and is willing to be healthy—just as in the framework\u0026lt;br\u0026gt; of traditional Christian ethics, the \u0027\u0027heretic\u0027\u0027 deserved humane\u0026lt;br\u0026gt; attention only insofar as he was potentially a true believer and\u0026lt;br\u0026gt; was willing to become one. In the one case, people are\u0026lt;br\u0026gt; accepted as human beings only because they might be healthy\u0026lt;br\u0026gt; citizens; in the other, only because they might be faithful\u0026lt;br\u0026gt; Christians. In short, neither was heresy formerly, nor is sick-\u0026lt;br\u0026gt; ness now, given the kind of humane recognition which, from\u0026lt;br\u0026gt; the point of view of an ethic of respect and tolerance, they\u0026lt;br\u0026gt; deserve\", \"priority\":2}]}, \"synonyms\":{}}");

	add("heretoga", "{\"term\":\"heretoga\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{PIE root|en|ker|dewk}}{{borrowing|ang|heretoga||army leader, commander, general|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Anglo-Saxon army leader or commander; a general; a duke\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, James Kendall Hosmer, \u0027A Short History of Anglo-Saxon Freedom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Like the old \u0027\u0027heretogas\u0027\u0027, they possessed no authority but such as was accorded them by their fellow-tribesmen, though when once constituted they had a power co-ordinate with that of the folk-moot\", \"priority\":3}]}, \"synonyms\":{}}");

